script: |
  super -f text -I q7508.spq | sort > q7508.out

inputs:
  - name: q7508.spq
    data: |
      SELECT DISTINCT - col1 FROM tab0 (FORMAT parquet) WHERE NULL NOT BETWEEN + + 77 + + CAST ( + col1 AS INTEGER ) + - + CAST ( - 83 AS INTEGER ) AND ( + + col0 + col0 );
  - name: tab0

outputs:
  - name: q7508.out
    data: |
